function mixed_number
  numerator = factorial(6) + factorial(4);
  denominator = factorial(5);
  quotient = numerator / denominator;

  % Convert the quotient to a mixed number
  whole_part = floor(quotient);
  fractional_part = quotient - whole_part;

  % Print the mixed number
  printf("%d %d/%d", whole_part, fractional_part, denominator);
end

