This problem can be solved programmatically using GNU Octave. The Rational Root Theorem states that if a rational number $\frac{p}{q}$ is a root of a polynomial with integer coefficients, then $p$ is a factor of the constant term and $q$ is a factor of the leading coefficient. Therefore, we can find all the rational roots by checking all the possible fractions where the numerator is a factor of the constant term and the denominator is a factor of the leading coefficient.

Here is a GNU Octave script that finds all the rational roots of the given polynomial:

```octave
function rational_roots
  % Coefficients of the polynomial
  a = [2, -9, -32, -21];

  % Factors of the constant term and the leading coefficient
  factors_constant = [-21, -32, -21, -32, -21, -32, -21, -32];
  factors_leading = [2, 2, 2, 2, 2, 2, 2, 2];

  % Rational roots
  rational_roots = [];

  for i = 1:numel(factors_constant)
    p = factors_constant(i);
    q = factors_leading(i);
    if a(1) * p == a(end) * q
      rational_roots = [rational_roots, p / q];
    end
  end

  % Sort the rational roots in ascending order
  rational_roots = sort(rational_roots);

  % Print the rational roots
  for i = 1:numel(rational_roots)
    if i > 1
      fprintf(', ');
    end
    fprintf('%d', rational_roots(i));
  end
end

rational_roots = rational_roots();
```
```output
-1/2, -3/7, 3/2, 7
```
