Let's denote the time Alice arrives as A and the time Bob arrives as B. Both A and B are uniformly distributed between 5:00 and 6:00, so their PDFs are both 1/60 (assuming minutes as the unit of time).

The condition we are interested in is |A - B| < 45. We can divide this into two cases:

1. A arrives before B: In this case, A - B < 45. We can integrate the joint PDF of A and B over the region where A - B < 45 to get the probability.

2. A arrives after B: In this case, B - A < 45. We can integrate the joint PDF of A and B over the region where B - A < 45 to get the probability.

The total probability is the sum of these two probabilities.

