We can use the permutation function in Octave to calculate the number of ways to draw 3 balls from 12, with replacement of the first ball but not the second.

The permutation function in Octave is `npr(n, r)`, which calculates the number of permutations of `n` items taken `r` at a time. In this case, we have 12 items (balls) and we want to take 3 at a time.

So, we can calculate the number of ways to draw 3 balls as `npr(12, 3)`.

However, since the first ball is replaced after it is drawn, we need to multiply the result by 12, because there are 12 possibilities for the first ball.

So, the total number of ways to draw 3 balls is `12 * npr(12, 3)`.

Here's a GNU Octave script to calculate the answer:

```octave
function ways = calculate_ways()
  total_balls = 12;
  balls_to_draw = 3;

  ways = 12 * npr(total_balls, balls_to_draw);
end

result = calculate_ways();
disp(result);
```

